import { Fragment } from "react"

function NewsCard(props) {
    return (
        <Fragment>
            <a style={{color: "inherit" ,textdecoration: "none"}} href="https://www.google.com/" target="_blank">
            <h2>{props.title}</h2>
            <img src={props.imgUrl} alt="Can't find!" width="100%" />
            <h4>{props.desc}</h4>
            <h5>{props.by}</h5>
            </a>
        </Fragment>
    )
}

export default NewsCard;
